import 'bootstrap/dist/css/bootstrap.min.css';
// eslint-disable-next-line import/no-unresolved

function header() {
    return (
        <div>
            <header>
        <nav>
            <img src="convert.png"/>
            <a href="index.html" class="nav-links-first">Home</a>
            <a href="https://encoders-decoders-app.netlify.app" class="nav-links" target="_blank">Encoders/Decoders</a>
            <a href="https://unitconvertorutility.netlify.app" class="nav-links" target="_blank">Unit Convertors</a>
            <a href="https://numberbaseconvertor.netlify.app/" class="nav-links" target="_blank">Number Base Convertors</a>
            <a href="https://stringutilities.netlify.app"class="nav-links" target="_blank">String Utility</a>
        </nav>
    </header>
        </div>
    );
}

export default header;
